        "mossyForest": MessageLookupByLibrary.simpleMessage("苔藓森林, 金马仑高原"),
        "mossyForestContent": MessageLookupByLibrary.simpleMessage(
            "苔藓森林是一种自然生态系统，仅生长在金马仑高原及马来西亚其他高山地区。低空云层在风的推动下将树木覆盖在持续的雾气和湿气中，为苔藓、蕨类、地衣和兰花等提供了理想的生境。这个潮湿的热带常绿森林也为多种山地物种提供了庇护所，包括蝴蝶、啮齿动物、青蛙、鸟类和哺乳动物，这些物种仅在这种寒冷气候中生存。"),
        "mountPulai": MessageLookupByLibrary.simpleMessage("普莱山, 柔佛"),
        "mountPulaiContent": MessageLookupByLibrary.simpleMessage(
            "普莱山位于柔佛州，海拔654米。由于其地理位置便利且易于进入，是新加坡人和当地人喜爱的徒步旅行目的地。普莱山山顶不对公众开放，因为它由军队看护，并设有两座通信塔。普莱山有一条14.3公里的环形步道，靠近古来，步道上有一个瀑布，难度适中。此步道还可用于露营、骑行、跑步和观赏自然景观。"),
        "mrtDescription": MessageLookupByLibrary.simpleMessage(
            "大众捷运（MRT）分为两条线路；第一条是双溪毛糯-加影线，全长51公里，沿线共有31个车站。所有车站每天早上6点开始运行。关闭时间因车站而异。单程票价从RM1.20起。服务热线：1800-82-6868"),
