            "如果您正在寻找没有游客的地方，请前往邦咯岛。邦咯岛位于霹雳州海岸附近，岛上有空旷的海滩、清澈的水和茂密的丛林。游客可以享受在棕榈树下晒太阳的机会，没有他人打扰。此外，还可以参观荷兰殖民时期的堡垒，并在传统的木质码头上拍照。"),
        "panoramaHill": MessageLookupByLibrary.simpleMessage("全景山, 双溪林明"),
        "panoramaHillContent": MessageLookupByLibrary.simpleMessage(
            "全景山位于双溪林明，距离关丹西北45公里。该山高271米，只有一条通往山顶的路径。从楼梯底部开始，逐步向上攀登。步道的主要特点是带有扶手的楼梯，仅有几段短距离没有楼梯。到达山顶时，您可以看到周边城市的全景。通常，游客需要30至45分钟才能登上全景山。"),
        "parks": MessageLookupByLibrary.simpleMessage("咖啡馆"),
        "penangNationalPark":
            MessageLookupByLibrary.simpleMessage("槟城国家公园, 槟城"),
        "penangNationalParkContent": MessageLookupByLibrary.simpleMessage(
            "这是马来西亚最小的国家公园，面积为23平方公里。其海滨森林是银叶猴、飞狐、豹猫以及各种蜥蜴、两栖动物和爬行动物的栖息地。徒步穿越丛林和乘船前往宁静的金色沙滩等活动足以充实一天。公园内有两条主要的徒步路线：一条沿着海岸线通往猴子海滩，另一条穿过山丘和丛林，通往更为僻静的海滩，那里的龟类保护区也在其中。"),
